// src/components/js/Login.js

import React from 'react';

const Login = () => {
    return (
        <div>
            <h2>Login</h2>
            <form>
                <div>
                    <label>Username:</label>
                    <input type="text" name="아이디" />
                </div>
                <div>
                    <label>Password:</label>
                    <input type="password" name="비밀번호" />
                </div>
                <button type="submit">Login</button>
            </form>
        </div>
    );
};

export default Login;
